import ReactGoogleSheets from 'react-google-sheets';
import * as Constants from './Constants'
import React, { Component } from 'react';
import './App.css';

class testDataComponent extends Component {

  constructor(props) {
    super(props)
    this.state = {
      sheetLoaded: false,
      players: []

    }
  }
  render() {

    const populatePlayerInfo = (row) => {
      let player = {};
      player.playerId = 1;
      player.playerId = 2;

      return player;
    }

    return (
      <ReactGoogleSheets 
        clientId={Constants.CLIENT_ID}
        apiKey={Constants.API_KEY}
        spreadsheetId={Constants.MTPL_MENS_SPREADSHEET_ID}
        afterLoading={() => this.setState({sheetLoaded: true})}
      >
        {this.state.sheetLoaded ? this.createPlayerProfile() : 'loading...'}
      </ReactGoogleSheets>
    )
  }
}

export default ReactGoogleSheets.connect(testDataComponent);
